import React from "react";
import "./index.css";
import "../Topfooter/index.js"

class Counter extends React.Component {
  state = {
    count: 0,
    topScore: 0,
    guessed: false,
  };

  clickCounter = () => {
    this.setState({ count: this.state.count + 1 });
  };
}
function Column(props) {
  return
  <div className="col-sm" {...props}>
    <img src = {props.img} onClick = {props.clickCounter} alt=""/>
  </div>


